import { Component } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Usuario } from './usuario.interface';
import { FormsModule } from '@angular/forms';

@Component({
  selector: 'app-registerusuario',
  templateUrl: './registerusuario.component.html',
  styleUrls: ['./registerusuario.component.css']
})
export class RegisterusuarioComponent {
  registerUsuario: Usuario = {
    id: 1, // Asignar un valor predeterminado o inicial para id
    nombres: '',
    correo: '',
    telefono: '',
    cedula: '',
    contrasena: ''
  };

  constructor(private http: HttpClient) { }

  submitForm(formData: any) {
    this.http.post<Usuario>('http://localhost:3000/usuarios', formData)
      .subscribe(
        (response) => {
          // La solicitud se completó exitosamente
          console.log(response);
        },
        (error) => {
          // Ocurrió un error al enviar la solicitud
          console.error(error);
        }
      );
  }
}
